import BottomAppBar from './bottomAppBar';
import ComposedTextField from './formularioRegistro';
import AppBarTop from './appBar';


class LoginRegisterComponent extends React.Component {
  render() {
    return (
      <div className="React">
      <AppBarTop/>
      <ComposedTextField/>
      <BottomAppBar/> 
      </div>
      );
  }
}

export default LoginRegisterComponent;
